    "content": "{'status': 'ok', 'data': [{'title': 'Green Pak Choi (Chinese Cabbage) with Soya Sauce', 'ingredients': '1 lb Green pak choi|1 tb Oil|1 tb Soya sauce|2 Cloves sliced garlic', 'servings': '1 servings', 'instructions': 'Wash pak choi and drain well. Heat oil and add the garlic then the pak choi. Stir constantly until the pak choi changes colour. Add the soya sauce to taste. Serve hot.'}, {'title': 'Hot and Sour Chinese Soup', 'ingredients': 'Hot & Sour Chinese Soup|3 c Chicken broth|1 tb Soy sauce, reduced-|Sodium|4 Chinese mushrooms,|Dried, soaked for 15|Minutes in boiling|Water, stems removed|No. 219 Yields 2 Servings|1 Cake soybean curd (tofu),|Cut into 2-inch strips|1/4 Wide|1/4 ts White pepper|2 tb Lemon juice|2 tb Cornstarch, mixed with|3 tb Water, cold', 'servings': '1 Servings', 'instructions': 'and caps cut into fine 1 egg, lightly beaten strips 2 tsps Oriental sesame oil, 1/2 cup bamboo shoots, cut in- or to 2-inch strips, 1/4- 1/4 tsp hot chili oil inch wide scallions, finely 1/4 lb pork, raw, lean, cut '}, {'title': 'Chicken with Chinese Mushrooms', 'ingredients': '1 c Soy sauce; or more to taste|1 ts Chopped fresh ginger|1/2 ts Baking soda|1 tb Sesame oil|Salt & pepper to taste|2 Boneless chicken breasts; diced 1-inch pieces|2 tb Cooking oil|1 c Onion;coarsely diced|1/2 c Bamboo shoots|1/2 c Water chestnuts|1 c Diced Chinese cabbage|1 c Coarsely chopped broccoli|1 c Bean sprouts|3 lg Chinese Black mushrooms; diced|1 pn (large) sugar|1 pn (large) five-spice powder|1 Splash oyster sauce|1 Splash soy sauce|1 c Chicken broth|2 tb Cornstarch|1/4 c Cold water', 'servings': '4 Servings', 'instructions': 'Combine 1 cup soy sauce, the ginger, baking soda, sesame oil, & a pinch each of salt & pep- per to make a marinade. Marinate the chicken for 2 hours, drain, & set aside. Preheat a wok over high heat w/ 2 tbs. cooking oil. Add onion & lightly stir-fry. Stir in chicken & then the remaining vegetables. Add sugar, five-spice powder, oyster sauce, & a splash of soy sauce. Add Chicken Broth & bring to boil. Mix corn- starch w/ water to make smooth paste. Slowly pour into Chicken Broth, stirring constantly until stock thickens & becomes clear. Serve. Note: Chinese black mushrooms are available fresh in some larger markets. Otherwise, you can buy them dried. With these, soak to recon- stitute,remove stems, & dice buttons. ORIENT EXPRESS KETCHUM; SUN VALLEY BEVERAGE: TSINGTAO BEER'}, {'title': 'Chicken with Chinese Vegetables', 'ingredients': '1 tb Vegetable oil|4 Skinnless; boneless chicken breasts, cut in bite-sized pieces|1 Onion; chopped|4 Stalks celery; chopped|2 Cloves garlic; minced|1 cn (4.5 oz) mushrooms; stems and pieces|1 cn (28-oz) chop suey vegetables|1/4 c Soy sauce|1 cn Chicken broth|Cooked rice or chow mein noodles', 'servings': '1 Servings', 'instructions': 'Brown chicken in vegetable oil. Add onions, celery and garlic, cook until browned. Drain chop suey vegetables, add to chicken mixture. Drain and add mushrooms. Add soy sauce and chicken broth. Cover, reduce heat, and simmer for about 30 minutes. Serve over cooked rice or chow mein noodles.'}, {'title': 'Chinese Barbecue Sauce - Char Sui', 'ingredients': '1/2 c Sherry|4 Cloves garlic|6 tb Soy sauce|2 ts Plum sauce|2 tb Black bean paste|6 tb Hoisin sauce|2 ts Salt|1 1/2 ts Chinese 5-spice|1/2 c Sugar', 'servings': '13 Servings', 'instructions': 'Mix together well. Heat in double boiler - add cornstarch for thickening.'}, {'title': 'Chinese Beef Jerky', 'ingredients': '3 lb Flank steak or London Broil|1/2 c Light Soya Sauce|4 1/2 c Dry Sherry|6 Garlic cloves, minced|1 1/2 tb Ginger, fresh, minced|1 1/2 tb Red pepper, crushed|1 1/2 tb Sesame oil|1 ds Pepper', 'servings': '36 Pieces', 'instructions': 'Cut meat in half, lengthwise and slice diagonally crosswise into paper thin strips 1 1/2\" to 2\" wide and 4\" long. Transfer to a shallow pan. Combine marinade ingredients and rub thoroughly into meat. Arrange meat on racks and let dry at cool room temperature overnight (do not refrigerate). Preheat oven to 250 degrees. Line two large baking sheets with foil and set wire racks on top of each baking sheet. Arrange meat on racks in single layer. Bake 30 minutes. Reduce heat to 175 degrees and continue to dry meat another 40 minutes. Meat should be lightly brown, but not burnt. Let meat contrinue to dry on racks at cool room temperature overnight before packing into jars. Dried meat can be brushed lightly with sesame oil for additional flavor and shine.'}, {'title': 'Chinese Chicken Pasta', 'ingredients': '1 tb Vegetable oil|1/2 lb Shiitake mushrooms, stems removed and caps sliced|1 tb Finely chopped fresh ginger|1/2 ts Minced garlic|1 c Chicken broth|2 tb Soy sauce|1 1/2 ts Asian sesame oil|1/4 ts Freshly ground pepper|2 c Diced cooked chicken|1/4 c Sliced green onions|1 bn Spinach (10 oz.), washed and chopped|1 lb Spaghetti, cooked according to package directions', 'servings': '6 Servings', 'instructions': 'Heat vegetable oil in large skillet over medium-high heat. Add mushrooms; cook 5 minutes. Add ginger and garlic; cook 1 minute more. Add chicken broth, soy sauce, sesame oil and pepper; bring to boil and cook 1 minute. Add cooked chicken, green onions and spinach. Toss with hot pasta. PER SERVING Calories 435 Total Fat 9 g Saturated Fat 2 g Cholesterol 42 mg Sodium 644 mg Carbohydrates 62 g Protein 27 g'}, {'title': 'Chinese Egg Rolls', 'ingredients': '1 pk Egg roll skins|1/2 Head cabbage, shredded|1/2 Head lettuce, shredded|1 c Water chestnuts|1 Small onion, chopped|1/2 lb Bean sprouts|1/2 c Celery, chopped|1 c Bell pepper, chopped|1/4 c Oil|1/2 lb Shrimp, cooked|1/2 lb Pork cubes, cooked|1 Egg yolk, beaten', 'servings': '1 Servings', 'instructions': 'Steam cabbage, lettuce, onion, celery and bell pepper until soft but not mushy. In a deep skillet, stir-fry the shrimp and pork in oil for three minutes. Add water chestnuts and cook for 5 minutes. Add cabbage mixture and stir, then add bean sprouts and cook until soft. Place a small amount of this mixture onto egg roll skin. Fold envelope-style (corners together) and seal with a slight amount of egg yolk., Deep fry until brown or fry in 1/2-inch of oil until brown on each side.'}, {'title': 'Chinese Egg Rolls: Skins [Large Qty]', 'ingredients': '2 lb Bread flour|4 Eggs, beaten|1 1/2 ts Salt|1 lb Water, cold', 'servings': '24 Egg-rolls', 'instructions': 'Sift the flour and salt together, place in the bowl of the mixing machine. Add the eggs and water, using the paddle, mix at slow speed until the dough is firm and smooth. Turn out the dough onto a floured board and let rest for 10 minutes, keep covered with a damp cloth. Using a rolling pin roll out the dough to a thickness of approximately 1/8 inch. Cut into 6 inch squares. Place 1 to 1 1/2 oz of filling on each 6 inch square of dough, fold in the two sides, so the filling cannot flow out, roll the filled dough tightly, dampen the end with water to secure. Fry the rolls in deep fat at 350F-180C u ntil golden brown; drain. '}, {'title': 'Chinese Leeks Sweet And Sour', 'ingredients': '1 lb Chinese leeks|6 tb Butter or margarine|2 tb Dark brown sugar|4 tb Red wine vinegar|1/2 c Chicken broth|Salt and pepper to taste', 'servings': '1 Servings', 'instructions': 'Prepare 1 lb Chinese leeks by trimming tops and roots. In a wok or frying pan, saute leeks in 6 tbs butter or margarine over low heat for 20 minutes or until soft. Stir occasionally. Add final ingredients and bring to a boil. Reduce to simmer, stirring occasionally for 12-15 minutes or until liquid is absorbed. Salt and peer to taste.'}]}",
    "tool_call_id": "call_hdGPD21IMXpYBorvjb6Qilnu"
  }
]

