    "name": "v1_recipe",
    "content": "{'status': 'ok', 'data': [{'title': 'Energy Bars, Banana/maple/walnut [Vegan]', 'ingredients': '2 Bananas; over-ripe|3 tb Maple syrup|3 tb Walnuts; toasted|2 tb Flour; vital gluten|1 1/3 c Rolled oats|1/2 c Oat bran|1 ts Vanilla extract|2 ts Lecithin; granules|1/4 ts Salt', 'servings': '6 Servings', 'instructions': 'Combine all ingredients in cusinart and blend until a nearly smooth paste. Spread in 8\"x8\" or 9\"x9\" pan or drop on cookie sheet and shape into \"cliff bar\" style bars. Bake at 350 for 15 minutes. Let cool completely before eating. NOTE: these are not as \"shiny\" as the other style energy bars. 210 calories per 1/6th recipe/per bar fat: 5.9g sat. fat: .8g cholesterol: 0 carbohydrate: 34.9g dietary fiber:4.4g protein: 9.5g sodium: 9.mg'}, {'title': 'Energy Bars, Berry [Vegan]', 'ingredients': '1/2 c Jam; loganberry or other|1/3 c Dried apricot halves|2 ts Lecithin; granules|1 tb Flour; vital gluten|1 1/3 c Rolled oats|1/3 c Oat bran|3 tb Apple juice; frozen concentrate, thawed', 'servings': '6 Servings', 'instructions': 'Combine all ingredients in cusinart and blend until a nearly smooth paste. Spread in 8\"x8\" or 9\"x9\" pan or drop onto cookie sheet and shape into \"cliff bar\" form. Bake at 350 for 15 minutes. Let cool completely before eating. 204 calories per 1/6th recipe/per bar fat: 3.3g sat. fat: .5g cholesterol: 0 carbohydrate: 41.6g dietary fiber:3.8g protein: 6.3g sodium: 15mg'}, {'title': 'Energy Bars, Chocolate [Vegan]', 'ingredients': '1/3 c Corn syrup|3 tb Brown sugar; packed|1/3 c Dates|2 tb Almonds; blanched|1 tb Flour; vital gluten|1 c Rolled oats|1/3 c Oat bran|3 tb Cocoa|1/4 c Coffee; cold', 'servings': '6 Servings', 'instructions': 'Combine all ingredients (except coffee) in cusinart and blend until it makes a nearly smooth paste. Add coffee in 1 tablespoon increments until the paste thins out and is the consistency of a thick spread. Bake in 8\"x8\" or 9\"x9\" pan at 350 for 15 minutes. You can vary the ingredients for different flavors--use other sugars instead of corn syrup, use jam instead of the raisins, use different nuts if you don\\'t want the pronounced flavor of peanut (like cashew, almond, hazlenut, etc.) Ideas: cashews/cocoa instead of vital gluten flour replace dates with: applesauce, banana, or raspberry jam It\\'s easy to get hooked on these! 205 calories per 1/6th recipe/per bar fat: 3.3g sat. fat: .6g cholesterol: 0 carbohydrate: 43.3g dietary fiber:4.1g protein: 6.4g sodium: 28mg'}, {'title': 'Energy Bars, Chocolate, Wheat Free [Vegan]', 'ingredients': '1/3 c Brown rice syrup|3 tb Brown sugar; packed|1/3 c Prunes|2 tb Cashews|3 tb Protein powder; soy, no wheat, dairy or egg|1 c Rolled oats; plus 2 tablespoons rolled oats|1/3 c Oat bran|3 tb Cocoa|1/4 c Coffee; cold, (you can substitute another liquid)', 'servings': '6 Servings', 'instructions': 'Combine all ingredients (except coffee) in cusinart and blend until it makes a nearly smooth paste. Add coffee/liquid until the paste thins out and is the consistency of a thick spread. Spread in 8\"x 8\" or 9\"x9\" pan or drop onto cookie sheet and form into the \"cliff\" bar shape. Bake at 350 for 15-20 minutes. Let cool completely before eating. You can vary the ingredients for different flavors--use other sugars instead of maple syrup, use jam instead of the prunes, use different nuts (like peanut, almond, hazlenut, etc.) Omit the coffee and use soy milk, water, or fruit juice. They pack very well and are great for hiking or cycling. 210 calories per 1/6th recipe/per bar fat: 3.1g sat. fat: .7g cholesterol: 0 carbohydrate: 38.3g dietary fiber:4.1g protein: 12g sodium: 6mg'}, {'title': 'Energy Bars, Oatmeal Peanut Butter [Vegan]', 'ingredients': '1/3 c Honey|1/3 c Raisins; seedless|3 tb Peanut butter|1 tb Flour; vital gluten|1 1/3 c Rolled oats|1/3 c Oat bran|3 tb Apple juice; frozen concentrate, defrosted|2 tb Soymilk; 1% vanilla, vitasoy, or plain/fat free|2 ts Lecithin; granules', 'servings': '6 Servings', 'instructions': 'Combine all ingredients in cusinart and blend until a nearly smooth paste. Spread in 8\"x8\" or 9\"x9\" pan or drop on cookie sheet and shape into a \"cliff bar\" shape. Bake at 350 for 15-20 minutes. Let completely cool before eating. You can vary the ingredients for different flavors--use other sugars instead of honey, use jam instead of the raisins, use different nuts if you don\\'t want the pronounced flavor of peanut (like cashew, almond, hazlenut, etc.) They pack easily and seem to improve in flavor overnight. However, it\\'s hard to make them last that long in my household! 253 calories per 1/6th recipe/per bar fat: 7.4g sat. fat: 1.3g cholesterol: 0 carbohydrate: 44g dietary fiber:3.7g protein: 8.2g sodium: 44mg'}, {'title': 'Energy Bars, Oatmeal/raisin [Vegan]', 'ingredients': '1/3 c Corn syrup|3 tb Brown sugar; packed|1/3 c Raisins; seedless|2 tb Peanut butter|1 tb Flour; vital gluten|1 1/3 c Rolled oats|1/3 c Oat bran|1/4 c Soy milk|1 tb Cinnamon', 'servings': '6 Servings', 'instructions': 'Combine all ingredients in cusinart and blend until a nearly smooth paste. Bake in 8\"x8\" or 9\"x9\" pan at 350 for 15-20 minutes. You can vary the ingredients for different flavors--use other sugars instead of corn syrup, use jam instead of the raisins, use different nuts if you don\\'t want the pronounced flavor of peanut (like cashew, almond, hazlenut, etc.) Ideas: cashews/cocoa instead of vital gluten flour replace raisins with: applesauce, banana, or raspberry jam 233 calories per 1/6th recipe/per bar fat: 4.5g sat. fat: .8g cholesterol: 0 carbohydrate: 45.6g dietary fiber:4.2g protein: 7.7g sodium: 55mg'}, {'title': 'Fresh Tomato and Basil Sauce (Vegan)', 'ingredients': '8 c Very ripe tomatoes; chopped/ about 5 lbs.|1 c Onions; chopped|2 Garlic cloves; minced|3 tb Fresh basil; finely chopped or 1 t. dried basil|1 tb Sugar|Salt and pepper; to taste|6 oz Tomato paste', 'servings': '8 Servings', 'instructions': 'D/L from Prodigy 12-14-94. Recipe collection of Sue Smith. 1.80á'}, {'title': \"Hoppin' John [Vegan]\", 'ingredients': '1 lb Black-eyed peas; dry|7 c Water|2 c Onions; coarse chop|8 Garlic cloves|1 c Carrots; sliced|1 c Celery; diced|1/4 ts Cayenne pepper; or more to taste|3 tb Balsamic vinegar|1 ts Salt; or to taste|2 Tomatoes|3 Scallions', 'servings': '8 Servings', 'instructions': 'Eat a bite at the midnight on December 31st for luck in the coming New Year! Soak the beans overnight (or at least 4 hours). Drain the soaking water, and cover with fresh water. Cook the beans until tender (about 30 min to an hour.) If using a pressure cooker, rinse the peas and cook at full pressure to 5-7 minutes. In a separate pot, steam \"saute\" the onions until caramelized, adding a little water and stirring at regular intervals until they are cooked down by about 60%. This takes about 30 minutes. Add the chopped celery and carrots to the onions, cook until tender. Then, add the cooked black-eyed peas, cayenne pepper, salt, and vinegar, adding the water the beans were cooked in so the consistency is that of a sauce or very thick soup. Cook an additional 5 minutes or so. Serve over rice. Top with chopped scallion and diced tomatoes. Pass the hot sauce for even more heat! kcal per serving: 220.9, fat: 1.0g, sat. fat: .2g, cholesterol: 0, carbohydrate: 40.9g, dietary fiber: 7.8g, protein: 14.5g, sodium: 453mg. note: The addition of red/yellow/and green bell pepper when adding the carrots and celery would be good too.'}, {'title': 'Celery-Rice Casserole (Vegan)', 'ingredients': '2 1/2 c Boiling [stock]|1 c Rice; uncooked|3 c Celery; sliced 1/2\" thick|1/2 c Onion; finely chopped|1/2 ts Marjoram|1/8 ts Salt|1/8 ts Pepper|Chopped celery leaves; for g|Garnish', 'servings': '6 Servings', 'instructions': 'D/L from Prodigy 12-14-94. Recipe collection of Sue Smith. 1.80á'}, {'title': \"Vt's Vlf Vegan Pastry Crust\", 'ingredients': '1/2 c Warm soymilk|3 tb Leftover mashed potatoes -or-|3 tb Instant mashed potato flakes mixed with:|2 1/2 tb Hot water|1 tb Maple syrup or honey|1 ts Regular dry yeast -or-|1/2 ts Instant yeast|1/4 c Whole wheat flour (not pastry flour)|1/2 ts Salt|2 tb Frozen apple juice|1 c Unbleached flour', 'servings': '1 Servings', 'instructions': 'Pastry for \"free form pies\" (you wrap the big piece of pastry up over the top) Mix together soymilk, potatoes, syrup or honey, and yeast in a medium bowl or a food processor bowl. Let stand 5 minutes. Add salt and flours. If using a food processor, process 30 seconds. Otherwise, mix and knead mixture on a lightly floured surface 5 minutes. (It says here to place in oiled bowl and oil top lightly, but I think we can figure out alternatives.) Cover and let rise until doubled, about an hour. Dough can also be allowed to rise in the \\'fridge 2-24 hours. kwvegan vegan 1. I usually have to add a bit of flour to it because it seems to be a bit too sticky to roll out easily. 2. I used non-fat milk instead of the soymilk without a problem. 3. I have used regular flour instead of the wheat and unbleached flour and it works just fine. 4. I haven\\'t bothered to oil the bowl. Since the dough is sticky anyway, I just peel it off the bowl and sprinkle it with flour when I shape it. 5. The dough rises a bit when it bakes. I spread it too thin on the bottom once and the top ended up twice as thick, so make sure you don\\'t skimp on the bottom crust, since it is weighted down with the filling. sally charette '}]}",
